}

NumberSeqFormHandler numberSeqFormHandler()
{
    if (!numberSeqFormHandler)
    {
        numberSeqFormHandler = NumberSeqFormHandler::newForm(VendParameters::numRefOneTimeSupplierAccount().NumberSequenceId,
                                                             element,
                                                             vendTable_DS,
                                                             fieldNum(VendTable, AccountNum)
                                                            );
    }

    return numberSeqFormHandler;
}

public void run()
