public void modified()
{
    FormStringControl control;

    super();

    if (logisticsPostalAddress.City)
    {
        if (!logisticsPostalAddress.CityRecId &&
            LogisticsAddressCity::cityCount(logisticsPostalAddress.City, logisticsPostalAddress.CountryRegionId, logisticsPostalAddress.State) > 1)
        {
            logisticsPostalAddress_ds.object(fieldNum(LogisticsPostalAddress,City)).lookup(control, logisticsPostalAddress.City);
        }

        element.updateControlBasedOnCountry();
    }
}

public void lookup(FormControl _formControl, str _filterStr)
{
    Query                   query;
    SysTableLookup          sysTableLookup;
    QueryBuildDataSource    queryBuildDataSourceView;

    query = new Query();
    sysTableLookup = SysTableLookup::newParameters(tableNum(LogisticsAddressCountryRegionNameView), _formControl);
    queryBuildDataSourceView  = query.addDataSource(tableNum(LogisticsAddressCountryRegionNameView));
    queryBuildDataSourceView.addRange(fieldNum(LogisticsAddressCountryRegionNameView, LanguageId)).value(queryValue(currentUserLanguage()));

    sysTableLookup.addLookupfield(fieldNum(LogisticsAddressCountryRegionNameView, CountryRegionId));
    sysTableLookup.addLookupfield(fieldNum(LogisticsAddressCountryRegionNameView, ShortName));
    sysTableLookup.setLabel("@SYS7576");
    sysTableLookup.addLookupfield(fieldNum(LogisticsAddressCountryRegionNameView, AddrFormat));

    sysTableLookup.parmQuery(query);
    sysTableLookup.performFormLookup();
}

public boolean validate()
{
    boolean isValid;
    List    fieldList;

    isValid = super();

    if (isValid)
    {
        fieldList = LogisticsAddressFormatLines::getFieldsByCountry(this.getValue());
        if (visibleFields != null && !fieldList.equalTo(visibleFields) && fieldList.elements() != 0 && prevCountryRegionId != '')
        {
            if (Box::yesNo("@SYS311370", DialogButton::Yes) == DialogButton::No)
            {
                isValid = false;
            }
        }
    }

    return isValid;
}

