}

public void makeNamesMandatory(FormStringControl _currentName, FormStringControl _name1, FormStringControl _name2)
{
    boolean isMandatory = !_name1.text() && !_name2.text();

    if (_currentName.text())
    {
        _name1.mandatory(false);
        _name2.mandatory(false);
    }
    else
    {
        _currentName.mandatory(isMandatory);
        _name1.mandatory(isMandatory);
        _name2.mandatory(isMandatory);
    }

    _currentName.update();
    _name1.update();
    _name2.update();
}

