public boolean modified()
{
    boolean ret, canEdit;

    ret = super();

    canEdit = (bankAccountID.text() != '');

    bankRoutingNumber.allowEdit(canEdit);
    bankSWIFTCode.allowEdit(canEdit);

    if (!canEdit)
    {
        bankRoutingNumber.text('');
        bankAccountNum.text('');
        bankSWIFTCode.text('');
        bankIBAN.text('');
        bankAccountNum.allowEdit(canEdit);
        bankIBAN.allowEdit(canEdit);
    }

    return ret;
}

public boolean modified()
