void clicked()
{
    MenuFunction menuFunction;

    Args args = new Args();

    vendOneTimeVendInvoiceForm.parmLogisticsPostalAddress(logisticsPostalAddress);
    vendOneTimeVendInvoiceForm.parmVendRecordType(recordType.selection());
    vendOneTimeVendInvoiceForm.parmOrganizationName(orgName.text());
    vendOneTimeVendInvoiceForm.parmPersonFirstName(firstName.text());
    vendOneTimeVendInvoiceForm.parmPersonMiddleName(middleName.text());
    vendOneTimeVendInvoiceForm.parmPersonLastName(lastName.text());
    vendOneTimeVendInvoiceForm.parmVendGroupId(vendGroup.text());
    vendOneTimeVendInvoiceForm.parmVendAccount(vendAccount.text());
    vendOneTimeVendInvoiceForm.parmTax1099RegNum(taxID.text());
    vendOneTimeVendInvoiceForm.parmTaxIDType(taxIDType.selection());
    vendOneTimeVendInvoiceForm.parmBankAccountId(bankAccountID.text());
    vendOneTimeVendInvoiceForm.parmBankAccountNumber(bankAccountNum.text());
    vendOneTimeVendInvoiceForm.parmBankIBAN(bankIBAN.text());
    vendOneTimeVendInvoiceForm.parmBankSWIFTNo(bankSwiftCode.text());
    vendOneTimeVendInvoiceForm.parmBankRoutingNumber(bankRoutingNumber.text());
    vendOneTimeVendInvoiceForm.parmlogisticsAddressStreet(logisticsPostalAddress_Street.text());

    vendOneTimeVendInvoiceService.init(vendOneTimeVendInvoiceForm);

    if (vendOneTimeVendInvoiceForm.validate() && this.isDuplicateVendAllowed())
    {
        args.caller(element);
        args.record(vendOneTimeVendInvoiceService.createVendTable());

        menuFunction = new MenuFunction(menuitemDisplayStr(PurchFormLetter_OneTimeVendInvoice), MenuItemType::Display);
        menuFunction.run(args);

        element.close();
    }
}

private boolean isDuplicateVendAllowed()
{
    VendTable    duplicateVend;
    boolean      isDuplicateAllowed = true;
    DialogButton dialogButton;

    duplicateVend = vendOneTimeVendInvoiceService.findDuplicateVendor();

    if (duplicateVend)
    {
        dialogButton = Box::okCancel(strFmt("@SYP4950119", duplicateVend.AccountNum), DialogButton::Yes);

        isDuplicateAllowed = (dialogButton == DialogButton::Ok);
    }

    return isDuplicateAllowed;
}
